import React from "react";
import "../../../Styles/Pages/Blog/BlogCard.scss";
import CalendarTodayIcon from "@material-ui/icons/CalendarToday";

function BlogCard() {
  return (
    <div className='blogCard'>
      <div className='blogPost__header'></div>
      <div className='blogPost__date'>
        <CalendarTodayIcon />
        <h4>Mars 31, 2021</h4>
        <span>&#8226;</span>
        <h4>ECOMMERCE</h4>
        <span>&#8226;</span>
        <h4>PRODUCTS</h4>
      </div>
      <h3>Payment performance metrics that matter</h3>
      <p>
        The metrics that served her well during her time leading payment teams
        and the steps she took to developand evangelize these.
      </p>
    </div>
  );
}

export default BlogCard;
